import React from 'react';
import './Climb.css';
import ClimbInstance from '../ClimbInstance/ClimbInstance';



const Climb = ({climbList}) => {

    return climbList.map((climb, index) => (
      <ClimbInstance climb={climb}/>

      ));



};

export default Climb;
